import React from "react";
import { Button, Container, TextField } from "@material-ui/core";
import DeleteIcon from "@material-ui/icons/Delete";
import {
  Card,
  CardActionArea,
  CardMedia,
  makeStyles,
  CardContent,
  Typography,
  AppBar,
  Toolbar,
} from "@material-ui/core";
import theme from "./theme";
const useStyles = makeStyles((theme) => ({
  button: { ...theme.mybutton },
  nav: { ...theme.myNav },
  small: {
    display: "none",
    [theme.breakpoints.up("sm")]: {
      display: "block",
    },
  },
  large: {
    display: "block",
    [theme.breakpoints.up("sm")]: {
      display: "none",
    },
  },
  textarea: {
    ...theme.textarea,
  },
  text: {
    fontFamily: "Rosarivo",
    fontSize: "50px",
    padding: theme.spacing(3),
  },
  root: {
    maxWidth: 445,
    textAlign:'center',
    backgroundColor
  },
}));
export default function Signup() {
  const classes = useStyles();
  return (
    <>
      <Typography variant="h1" className={classes.text}>
        Buy and Ship to Anywhere in the World
      </Typography>
      <Card className={classes.root}>
        <CardContent>
          <form className={classes.root} noValidate autoComplete="off">
            <Typography
              gutterBottom
              variant="h5"
              component="h2"
              style={{ textAlign: "center", fontFamily: "Rosarivo" }}
            >
              Sign Up
            </Typography>
            <TextField
              required
              className={classes.textarea}
              id="filled-basic"
              label="Email Address"
              variant="outlined"
            />
            <br />
            <TextField
              required
              className={classes.textarea}
              id="outlined-basic"
              label="Password"
              variant="outlined"
            />
            <br />
            <TextField
              required
              className={classes.textarea}
              id="outlined-basic"
              label="Confirm Password"
              variant="outlined"
            />
            <br />
            <Button
              variant="contained"
              type="submit"
              color="primary"
              className={classes.button}
              style={{ marginLeft: theme.spacing(14), width: "150px" }}
            >
              Sign Up
            </Button>
          </form>
        </CardContent>
      </Card>
    </>
  );
}
